package com.ufgov.zc.server.console.service.impl;import java.util.List;import com.ufgov.zc.common.console.model.AsEmp;import com.ufgov.zc.common.system.dto.ElementConditionDto;import com.ufgov.zc.server.console.dao.IAsEmpDao;import com.ufgov.zc.server.console.service.IAsEmpService;public class AsEmpService implements IAsEmpService {  private IAsEmpDao asEmpDao;  public IAsEmpDao getAsEmpDao() {    return asEmpDao;  }  public void setAsEmpDao(IAsEmpDao asEmpDao) {    this.asEmpDao = asEmpDao;  }  public AsEmpService() {  }  public List getOrgAsEmp(ElementConditionDto dto) {    return asEmpDao.getOrgAsEmp(dto);  }  public AsEmp getProviderInfoByCA(ElementConditionDto dto) {    return asEmpDao.getProviderInfoByCA(dto);  }  public List getAsEmp(AsEmp emp) {    return asEmpDao.getAsEmp(emp);  }}